uint32_t JumpStatus(void){
    uint32_t input = 0;
    input = GPIOB->DIN31_0 & 0x20000; //gets 16 and 17 input
    return input; // replace this line
}

uint32_t LeftOrRight(uint32_t n){ // 0-2000 position  will return
    if(n>=1200){
        return 0; //right status?
    }
    if(n<=800){
        return 1; //left status?
    }
    return 2; //dont move status1
}

