// games  engine runs at 30Hz
void TIMG12_IRQHandler(void){uint32_t pos,msg;
  if((TIMG12->CPU_INT.IIDX) == 1){ // this will acknowledge
    GPIOB->DOUTTGL31_0 = GREEN; // toggle PB27 (minimally intrusive debugging)
    GPIOB->DOUTTGL31_0 = GREEN; // toggle PB27 (minimally intrusive debugging)
    Data = ADCin();    // sample 12-bit ADC0 channel 5, slidepot
    // store data into mailbox
    Flag = 1;// set the semaphore
    play = 0;
     //static uint32_t played = 0;
     now = JumpStatus(); // if jump is pressed then it will equal 0x20000

     if(coinStatus==1){
         if(stopCoin==0){
             play = 1;
             stopCoin = 1;
             Size = 10424;
             Sound_Begin();
         }
     }

     if(coinStatus != 1){
         stopCoin = 0;
     }

     if (squashStatus == 1){
         if (stopSquash == 0){
         play = 4;
         stopSquash = 1;
         Size = 2367;
         Sound_Begin();
         }
     }

     if(squashStatus != 1){
         stopSquash = 0;
     }

     if(now == 0x20000 /* now == 458752 */ ){ //pb17
          if (stopJump == 0){
          play = 2;
          stopJump = 1;
          Size = 6506;
          Sound_Begin();
          }

     }

     if( (now != 0x20000)){
         stopJump = 0;
     }



// game engine goes here
    // 1) sample slide pot
    // 2) read input switches
    // 3) move sprites
    // 4) start sounds
    // 5) set semaphore
    // NO LCD OUTPUT IN INTERRUPT SERVICE ROUTINES
    if(Flag==1){     // wait for semaphore
        Flag=0;     // clear the semaphore
        Position = Convert(Data);  // convert Data to Position
        status1 = LeftOrRight(Position); //slide pot status
        status2 = JumpStatus(); //jump button status
         }
    GPIOB->DOUTTGL31_0 = GREEN; // toggle PB27 (minimally intrusive debugging)
  }
}
uint8_t TExaS_LaunchPadLogicPB27PB26(void){
  return (0x80|((GPIOB->DOUT31_0>>26)&0x03));
}


